import style from "./Input.module.css";

const Input = () => {
  return (
    <div className={style.input}>
      <div>Input</div>
      <div>
        <div><input type="text" placeholder="input id"/></div>
        <div><input type="text" placeholder="input name"/></div>
        <div><input type="text" placeholder="input price"/></div>
      </div>
      <div>
        <button>추가</button>
        <button>취소</button>
      </div>
    </div>
  );
};

export default Input;
